INSERT INTO `content_type_ddblock_nnydbuzz` (`vid`, `nid`, `field_pager_item_text_value`, `field_slide_text_value`, `field_image_fid`, `field_image_list`, `field_image_data`) VALUES 
(37, 37, 'P1', 'Elections Next Door Elections Next Door Elections Next Door Elections Next Door Elections Next Door Elections Next Door Elections Next Door Elections Next Door Elections Next Door Elections Next Door Elections Next Door Elections Next Door Elections Next Door ', 20, 1, 'a:1:{s:11:"description";s:0:"";}'),
(38, 38, 'P2', 'The nation was shocked to see Varun Gandi surrender in Pilibhit.', 21, 1, 'a:1:{s:11:"description";s:0:"";}'),
(39, 39, 'P3', 'It was rather delightful to see the news about supreme court denying Sanjay Dutt permission to contend in Elections.', 22, 1, 'a:1:{s:11:"description";s:0:"";}'),
(40, 40, 'P4', 'The world takes a breath of relief as recession seems to weaken its hold over the corporate .', 23, 1, 'a:1:{s:11:"description";s:0:"";}'),
(41, 41, 'P5', 'Donate for the Cause. Donations are always welcome for NNYD.', 24, 1, 'a:1:{s:11:"description";s:0:"";}'),
(80, 80, 'p6', 'Please do not vote for a contestant with criminal record...Lets pledge to vote for an educated candidate.If you believe in this, please propagate this idea.', 77, 1, 'a:1:{s:11:"description";s:0:"";}'),
(134, 134, 'a', '"There is a work that my father had started, a dream he had dreamt. I come to you today saying…allow me to turn that dream into reality" : Rahul Gandhi in his address to the people of Amethi during the recent election campaign, clad in his trademark spotless white kurta-pyjama.', 344, 1, 'a:1:{s:11:"description";s:12:"rahul gandhi";}'),
(135, 135, 'b', 'Chief Minister Shri Narendrabhai Modi has announced a Skill Enhancement Training and Aid package for the diamond artisans, who are facing the adverse impacts of global meltdown. Global economy goes on a downward spiral; many diamond artisans are facing the crisis of unemployment. With a view to provide alternate employment and skill enhancing training to such diamond workers, a special relief package is declared.', 290, 1, 'a:1:{s:11:"description";s:13:"narendra modi";}'),
(136, 136, 'c', 'Chief Minister Shri Narendrabhai Modi has called upon the Nari-Shakti of Gujarat to play a crucial role in State''s development. State Government has undertaken slew of measures to empower the womenfolk. Women are engaged in economic activities. They are also playing an important role in the administrative process. Chief Minister was addressing a women mega convention at Dhoraji today.', 346, 1, 'a:1:{s:11:"description";s:77:"Women would play a crucial role in the development of Gujarat: Chief Minister";}'),
(137, 137, 'd', 'Very soon world''s largest democracy is going to see an election, and the best step which EC has taken is blanket ban on exit polls till last phase of polls I appreciate the steps EC has taken for the worlds largest democracy because this matters a lot for voters.', 345, 1, 'a:1:{s:11:"description";s:0:"";}');
