(13, 13, 1, 'Introduction', 'Nav Nirman Yuva Dal, promises to bring a social revolution, by attracting young blood into main stream politics. The party aims to usher in a fresh breath of life to the indian political system by 1.Cleaning up the inefficient beauracratic system 2.Bringing more transperancy in decisions 3.Making primary education compulsary 4.Providing the best Infrastructure facilities to each and every village and town across the length and breadth of the county.', 'Nav Nirman Yuva Dal, promises to bring a social revolution, by attracting young blood into main stream politics. The party aims to usher in a fresh breath of life to the indian political system by 1.Cleaning up the inefficient beauracratic system 2.Bringing more transperancy in decisions 3.Making primary education compulsary 4.Providing the best Infrastructure facilities to each and every village and town across the length and breadth of the county.', '', 1235453871, 1),
