(43, 43, 1, 'Welcome to NNYD site', 'Nav Nirman Yuva Dal is the concept of an Non-Residential Gujarati, Mr. Roshan Shah, who like any other NRI was quite taken aback by the current state of affairs in the country and decided to voice his opinion. He used the channel of the various web properties, that he either acquired or developed as part of the products which his company BPO Canada made, to voice his views about Gujarat in particular and India in general. One can easily find a number of articles published by him on www.gujjuweb.com. When the idea of forming a party came to him, he along with a group of employees of Drupal Designs Software Services Pvt. Ltd. (DDSSPL) formed the political party and named it Nav Nirman Yuva Dal (on the famous Nav Nirman movement taken up by a group of students in Ahmedabad)', 'Nav Nirman Yuva Dal is the concept of an Non-Residential Gujarati, Mr. Roshan Shah, who like any other NRI was quite taken aback by the current state of affairs in the country and decided to voice his opinion. He used the channel of the various web properties, that he either acquired or developed as part of the products which his company BPO Canada made, to voice his views about Gujarat in particular and India in general. One can easily find a number of articles published by him on www.gujjuweb.com.', '', 1239735940, 1),
