(142, 142, 1, 'Gujarat Youth Congress to hold repoll at 14 places', 'It has been decided to hold repoll at 14 places in Gujarat as large scale irregularities were reported from these places in the polling of the Youth Congress on Tuesday. Elections of Youth Congress were held in all 182 Assembly segments in Gujarat.\r\nAnnouncing this, Ashok Tanvar said that 55 to 60 percent polling was reported in the State. He said that it showed large scale involvement of youth in the elections. Gujarat is the second state after Punjab where elections of Youth Congress are being held. To a question, he said that in Punjab polling percentage was 35 per cent.  He described irregularities as over enthusiasm of the members, but asserted that action would be taken against members involved in these incidents. He said that already one member Karnsinh was suspended in the Naroda area of Ahmedabad.  Patan city, Mehsana, Nikol, Naroda and Asarwa in Ahmedabad, Rajkot, Navsari, Gandevi, Udhna, Bhavnagar, Gadhada, , Surat, Karjan, Chhota Udaipur, , Dabhoi, Junagadh and Una are the places where repolling  will be done.  \r\n\r\nIn every Assembly segment 16 members are to be elected and as a result there will be 2912 elected delegates of Youth Congress in Gujarat, he said. State level elections are to be held on April 5.', 'It has been decided to hold repoll at 14 places in Gujarat as large scale irregularities were reported from these places in the polling of the Youth Congress on Tuesday. Elections of Youth Congress were held in all 182 Assembly segments in Gujarat.\r', '', 1240294232, 1),
