(134, 134, 1, 'Rahul Gandhi Indias Next Generation Political hopeful', 'Rahul Gandhi fires Amethi''s imagination\r\n\r\nPRESS TRUST OF INDIA\r\n\r\nAmethi, April 20: The magic of the Nehru-Gandhi clan seems to be overbearing on this dusty Uttar Pradesh town where Rahul Gandhi, the youngest member of the dynasty to plunge into electoral politics, is in fray for the Lok Sabha polls.\r\n\r\nThat magical surname ‘Gandhi’ and the promise to complete his father and former Prime Minister Rajiv Gandhi''s dream for the constituency are enough to lead Rahul to a landslide victory against his rivals Ram Vilas Vedanti of BJP, Chandraprakash Mishra of BSP and nine others.\r\n\r\nExpecting Congress president Sonia Gandhi to contest from Amethi, Samajwadi party did not field its candidate in the constituency.\r\n\r\nAs Rahul criss-crosses the constituency, he evokes the memories of his father. "He looks just like his father," says Durga Devi as she gets back to harvesting the wheat crop in nearby fields.\r\n\r\nRahul fires the imagination of the people of Amethi by promising to fulfill his father''s dream for the constituency. "There is a work that my father had started, a dream he had dreamt. I come to you today saying allow me to turn that dream into reality," he tells the people here, charming them with his every move.\r\n\r\nA Congress bastion, Amethi has in the past elected Rahul''s parents and uncle. So strong is the family name in Amethi that the party has won 11 of the last 13 Lok Sabha polls.', 'Rahul Gandhi fires Amethi''s imagination\r\n\r\nPRESS TRUST OF INDIA\r\n\r\nAmethi, April 20: The magic of the Nehru-Gandhi clan seems to be overbearing on this dusty Uttar Pradesh town where Rahul Gandhi, the youngest member of the dynasty to plunge into electoral politics, is in fray for the Lok Sabha polls.\r\n\r\nThat magical surname ‘Gandhi’ and the promise to complete his father and former Prime Minister Rajiv Gandhi''s dream for the constituency are enough to lead Rahul to a landslide victory against his rivals Ram Vilas Vedanti of BJP, Chandraprakash Mishra of BSP and nine others.\r\n\r', '', 1239728742, 1),
(135, 135, 1, 'Gujarat Chief Minister, Mr. Narednra Modi announces “Skill-Enhancement-Aid-Package” for the unemployed Diamond-Artisans', 'Stipend of Rs.100/ per day for all the Trainees: Unemployed Diamond-Artisans from Surat, Ahmedabad and Bhavnagar are to be covered initially\r\n \r\nChief Minister Shri Narendrabhai Modi has announced a Skill Enhancement Training and Aid package for the diamond artisans, who are facing the adverse impacts of global meltdown. Global economy goes on a downward spiral; many diamond artisans are facing the crisis of unemployment. With a view to provide alternate employment and skill enhancing training to such diamond workers, a special relief package is declared.\r\n \r\nUnder the skill enhancement-aid package, in the primary stage, training and aid would be made available to the meltdown affected diamond workers of Surat, Ahmedabad and Bhavnagar.\r\n \r\nAgainst the wage-loss, unemployed diamond-artisans would get stipend of Rs.100 per day during their training period. Stipend limit is fixed up to Rs.2500/ per month. Training module-Four Months Training Module- is designed to train them for diamond assortment, bruiting, grading of diamonds, planning and making, jewellery making, and other trade related skills. Once they finish the training, State Government would initiate procedures for their loan under Vajpayee bankable scheme, Kutir and Gramodhyog schemes, and Prime Minister''s employment programme.\r\n \r\nCurricula of Skill enhancement training module are to be decided in consultation with Gujarat Council for Vocational Training and I.D.I of Indian Government. Five institutes have been short-listed. Which includes (1) Indian Diamond Institute, Surat (2) National Institute of Design (NID) Ahmedabad (3) National Institute of Fashion Technology (NIFT), Gandhinagar (4) Gujarat Diamond Industries Training Institute, Rakhial, Ahmedabad. (5) National Institute of Jewellery design. Renowned government, non-government and private institutes may be roped in for providing training.\r\n \r\nTraining institutes are to be paid Rs.2700/ per trainee, for their tuition- fees, certification, exam-fees, procuring training materials and other expenses.\r\n \r\nIn the first phase, Rs.12 Crore have been sanctioned to train 15000 diamond workers. Director of employment and vocational training and Industries Commissioner will jointly organize and implement the skill enhancement package.\r\n \r\nUnder the guidance of Principal Secretary Industries and Mines a state-level committee will execute the programme in three cities. A district level committee would function under District Collector, and would explore alternate employment options.\r\n \r\nInformation Bureau, Government of Gujarat, Date: 28/02/2009', 'Stipend of Rs.100/ per day for all the Trainees: Unemployed Diamond-Artisans from Surat, Ahmedabad and Bhavnagar are to be covered initially\r\n \r\nChief Minister Shri Narendrabhai Modi has announced a Skill Enhancement Training and Aid package for the diamond artisans, who are facing the adverse impacts of global meltdown. Global economy goes on a downward spiral; many diamond artisans are facing the crisis of unemployment. With a view to provide alternate employment and skill enhancing training to such diamond workers, a special relief package is declared.\r\n \r', '', 1239298482, 1),
(136, 136, 1, 'Women would play a crucial role in the development of Gujarat: Chief Minister', 'Chief Minister Shri Narendrabhai Modi has called upon the Nari-Shakti of Gujarat to play a crucial role in State''s development. State Government has undertaken slew of measures to empower the womenfolk. Women are engaged in economic activities. They are also playing an important role in the administrative process. Chief Minister was addressing a women mega convention at Dhoraji today.\r\n \r\nChief Minister distributed aids, benefits, and tools to women beneficiaries under various welfare and development schemes. Shri Narendrabhai Modi dedicated Bhadar-2 linked group water supply scheme. Rs 13 crore water supply project would provide drinking water supply to 30 villages. When water supply gets erratic, womenfolk face the hardships of water scarcity. For long term solutions to water crisis in rural areas, Water committees are formed in thousands of villages. Such committees'' functions under women leadership, they look after water distribution and maintenance.\r\n \r\nAnganvadies are playing very important role in child development. The Anganwadi workers are given uniforms by State Government. Recently formed Yashoda Gaurav Nidhi ensures dignity and respect to retiring Anganwadi workers. From the corpus, Anganwadi workers would get retirement benefits up to Rs.1.75 lakhs.\r\n \r\nChiranjeevi scheme has saved the lives of poor mothers and children. UNICEF and commonwealth countries are impressed by its success. Now Bal-Sakha scheme takes care of new born babies. The healthcare expenditure of mothers and children up to one year is to be borne by State Government. A people''s movement is launched to tackle malnutrition in pregnant mother and children. People are donating Sukhadi.\r\n \r\nAs a revolving fund for 356 self help women groups, Shri Narendrabhai Modi handed over a cheque of Rs. 17.80 lakhs. He also distributed sewing machines to the beneficiaries, gave way a cheque of Rs.2.33 lakh under Balika Samrudhdhi scheme. He had given away a cheque to the president of water committee as self reliance reward.\r\n \r\nRevenue Minister Smt Anandiben Patel said, “Under the leadership of Chief Minister, separate department is formed .With the outlay of Rs.1000 crores, it has operationlised various welfare and development schemes for women. Integrated child development project falls under the purview of Women and Child Welfare department. Training is given to 10000 women for making them self reliant.\r\n \r\nWater Resources Minister Shri Nitinbhai Patel said that gone is the era, when water was being supplied to villages by water tankers. The drinking water grid laid across the State provides drinking water to 10346 villages and 112 towns. Out of 18000 villages, 10000 villages would get water of Narmada.\r\n \r\nM.P. Shri Haribhai Chaudhari ,MLA Smt Jashumatiben Korat, Former M.P. Shri Bhavanaben Dave, Shri Madhuben Patel, Chairman Social Welfare Board Smt Jayshriben Patel also addressed the convention.\r\n \r\nEminent leaders, MLAs, office bearers, top officials were among the others who attended the mega convention of women.\r\nInformation Bureau,Government of Gujarat,Date: 19/02/2009', 'Chief Minister Shri Narendrabhai Modi has called upon the Nari-Shakti of Gujarat to play a crucial role in State''s development. State Government has undertaken slew of measures to empower the womenfolk. Women are engaged in economic activities. They are also playing an important role in the administrative process. Chief Minister was addressing a women mega convention at Dhoraji today.\r\n \r', '', 1239803884, 1),
(137, 137, 1, 'Political Theatre (Please Vote)', 'REF - http://www.khadayataonline.com/blog/sshah/political-theatre-please-vote  Political Theatre  Politics!  Is it  &quot;BIG&quot; ? What do you think? what I think is common man hate this word, I do not know about you, but i do hate it too, any how it is fact politics is politics and we cannot ignore it.\r\n\r\nVery soon world''s largest democracy is going to see an election, and the best step which EC has taken is blanket ban on exit polls till last phase of polls I appreciate the steps EC has taken for the worlds largest democracy because this matters a lot for voters.  \r\n\r\nNow obiviouos question for every Indian is.  Who is next?  But do you think it is that important?  Some countries who is Strategic Partner of India, also will be eager to know Who is next, I can''t compare this with the US Elections as it is one of the largest economy and Most of the Contries in world have direct interest in US including India.  But  I can be sure US will have intrest on the Indian elections because of Importance of India to control Terrorism Factory from Indian Neigbouring Countries where US cannot continue its military aid or actions during the time of recession, and the aid which is provided to them is also of no use.  Election date is out, the Code of Conduct is deployed.  War of words has already began and thats what I call to an Election Campaign War of words or a Blame Game, most of the politician do is just blame each other personally, thats what they fill is the best way to get seat, for them aim is to get seat and they are good in it, the blame game may help them to brain wash some of people but not all. Now the another question I would like to mention is. \r\n\r\nPoliticians are good at gettting their seat. Then what about us. Where are we good at? -ask your self.  You would not have forgot when in last election Mrs Sonia Gandhi called Mr. Modi as &quot;Merchant of Death&quot; in Gujarat and in reply Modi called her as &quot;Italian Dog&quot;, which does not help to any of parties, Congress did not get enough seat in Gujarat while BJP did not get the power for center but was able to manage in Gujarat.  During Last elections the main party most preferably a winner who did the real changes was DMK from Tamil Nadu where all the 39 available seat from Tamilnadu went to DMK a clean swift, isn''t it? DMK supported UPA. Moral of the story is people from Tamilnadu was smart enough or rather they have asked them self  &quot;Where are we Good At?&quot;  to understand, whoever is the PM, They should remember that they have to take care of Tamil Nadu well and so they went and vote.  There is always inconsistency at central level atleast as of now where PM comes through Alliance and so he has to manage all parties and the states which belongs to respective parties. To make sure that they does not lose support and this is the fact which no one can change it but I feel it is much better for states having their own political parties consider the example of Tamil Nadu in last election.  Because of this incosistency at central level many people do not like to vote in election considering the Governement is doing nothing for them, which is not a good idea, You should also believe that the who ever PM is, there is always a politics involved in it and a thing is common for each parties, that is! they can''t ignore us to get Seat again and so development must be in agenda, whatever they have done in last five years will directly reflects in next Election, we know we are not blind and so politician knows it. \r\n\r\nThe other worst thing in Indian Politics is corruption which I prefer is much better now atleast in Gujarat, then how it was before, being a Gujarati I know about Gujarat, and it is not tough to find out who is corrupted or where corruption occurs when there are so many local media as well as central  media available. Corruption is always the problem and can be sorted out by Negative Votes. Good news is even Election Commision is also looking seriously in this matter to provide a button which says &quot;None Of The Above&quot; BINGO  for voters if it comes to reality, EC has also appointed the 5 judge committee to find out the possibility and feasibility, and the great stuff is political parties are shaken. As they knows if it comes true corrupted persons cannot stand in elections which is more than half in every parties.  So at last I would say Your Vote is valuable please Vote. Atleast just go for Vote Booth where you may find a button &quot;None of the Above&quot;.</p>', 'REF - http://www.khadayataonline.com/blog/sshah/political-theatre-please-vote  Political Theatre  Politics!  Is it  &quot;BIG&quot; ? What do you think? what I think is common man hate this word, I do not know about you, but i do hate it too, any how it is fact politics is politics and we cannot ignore it.\r\n\r\nVery soon world''s largest democracy is going to see an election, and the best step which EC has taken is blanket ban on exit polls till last phase of polls I appreciate the steps EC has taken for the worlds largest democracy because this matters a lot for voters.  \r\n\r', '', 1240289915, 1),
