(140, 140, 1, 'Mulayam Singh - SP''s manifesto Against Nation''s Youth', 'Lucknow, Apr 11: The Samajwadi Party (SP) released its party manifesto on Saturday, Apr 11 at press conference.\r\n\r\nMulayam Singh Yadav, while releasing the manifesto vowed to abolish the ''expensive education in English''. SP manifesto also speaks of reducing the use of computers which in turn generate more jobs. Ironically Mulayam''s sons had their education in English medium schools.\r\n\r\nThis states that today''s growth of youth is stopeed by SP if they win to secure the PM - seat.\r\n', 'Lucknow, Apr 11: The Samajwadi Party (SP) released its party manifesto on Saturday, Apr 11 at press conference.\r\n\r\nMulayam Singh Yadav, while releasing the manifesto vowed to abolish the ''expensive education in English''. SP manifesto also speaks of reducing the use of computers which in turn generate more jobs. Ironically Mulayam''s sons had their education in English medium schools.\r\n\r\nThis states that today''s growth of youth is stopeed by SP if they win to secure the PM - seat.\r\n', '', 1239655138, 1),
(143, 143, 8, 'Singing talent show on star plus', '12 talented kids from the age group of 10-16 years have been short listed and all of them have one common dream - to become the Voice of India. They battle it out under the watchful eye of experts, and the loving care of their mothers, as they live their dream of making a debut into the world of entertainment. Mothers will groom, support and manage them, be involved in every stage of the performance – song selection, rehearsals, choreography, costumes; and will take onus for every performance of her ward through the show.\r\n\r\nAdding to the entertainment quotient, there will be some thrilling, dare-devil stunts that the mother will need to perform, to prove the extent of her love and determination to make her child the Amul Voice of India.\r\n\r\nThe Amul Voice of India team has scouted the mother-child pairs from across many cities in India. They are Aditya Vijay Bhandari (Varanasi), P. Bhavini (Bhopal), Soham Himanshubhai Naik (Navsari), Yash Bharatkumar Shah (Baroda), Sayali Kishor Kambli (Mumbai), Swastika Bandyopadhyay (Mumbai), Akash Prakash Jagdhane (Mumbai), Roddur Dutta (Kolkata), Trishita Maitra (Satna), Shivish Soni (New Delhi), Vaishnavi Tyagi (New Delhi) and Kritika Kukreti (New Delhi).\r\n\r\nProduced by SOL, Amul Voice of India – Mummy Ke Superstars, not only continues to celebrate a child’s intrinsic talent on a nationwide platform, but viewers will enjoy a special theme and famous celebrity judges on every episode of Amul Voice of India.', '12 talented kids from the age group of 10-16 years have been short listed and all of them have one common dream - to become the Voice of India. They battle it out under the watchful eye of experts, and the loving care of their mothers, as they live their dream of making a debut into the world of entertainment. Mothers will groom, support and manage them, be involved in every stage of the performance – song selection, rehearsals, choreography, costumes; and will take onus for every performance of her ward through the show.\r\n\r', '', 1239826944, 1),
