INSERT INTO `node_type` (`type`, `name`, `module`, `description`, `help`, `has_title`, `title_label`, `has_body`, `body_label`, `min_word_count`, `custom`, `modified`, `locked`, `orig_type`) VALUES 
('page', 'Page', 'node', 'A <em>page</em>, similar in form to a <em>story</em>, is a simple method for creating and displaying information that rarely changes, such as an "About us" section of a website. By default, a <em>page</em> entry does not allow visitor comments and is not featured on the site''s initial home page.', '', 1, 'Title', 1, 'Body', 0, 1, 1, 0, 'page'),
('story', 'Story', 'node', 'A <em>story</em>, similar in form to a <em>page</em>, is ideal for creating and displaying content that informs or engages website visitors. Press releases, site announcements, and informal blog-like entries may all be created with a <em>story</em> entry. By default, a <em>story</em> entry is automatically featured on the site''s initial home page, and provides the ability to post comments.', '', 1, 'Title', 1, 'Body', 0, 1, 1, 0, 'story'),
('blog', 'Blog entry', 'blog', 'A <em>blog entry</em> is a single post to an online journal, or <em>blog</em>.', '', 1, 'Title', 1, 'Body', 0, 0, 1, 1, 'blog'),
('forum', 'Forum topic', 'forum', 'A <em>forum topic</em> is the initial post to a new discussion thread within a forum.', '', 1, 'Subject', 1, 'Body', 0, 0, 1, 1, 'forum'),
('article', 'Article', 'node', '<em>Articles</em> are similar to stories but do not include comments and they are categorized according to their contents.', '', 1, 'Title', 1, 'Body', 0, 1, 1, 0, ''),
('event', 'Event', 'node', 'Events have a start date and an optional end date as well as a teaser and a body. They can be extended by other modules, too.', '', 1, 'Title', 1, 'Body', 0, 1, 1, 0, 'event'),
('ddblock_nnydbuzz', 'NNYD Buzz', 'node', 'Get the latest buzz at nnyd...', '', 1, 'Title', 1, 'Body', 0, 1, 1, 0, ''),
('book', 'Book page', 'node', 'A <em>book page</em> is a page of content, organized into a collection of related entries collectively known as a <em>book</em>. A <em>book page</em> automatically displays links to adjacent pages, providing a simple navigation system for organizing and reviewing structured content.', '', 1, 'Title', 1, 'Body', 0, 1, 1, 0, 'book'),
('video', 'Video', 'node', 'Adds videos', '', 1, 'Title', 1, 'Body', 0, 1, 1, 0, ''),
('profile', 'Profile', 'node', 'A user profile built as content.', '', 1, 'Title', 1, 'Body', 0, 1, 1, 0, 'profile'),
('join_nnyd_form', 'NNYD Membership', 'node', 'Join NNYD', '', 1, 'Title', 0, '', 0, 1, 1, 0, ''),
('advpoll_binary', 'Binary poll', 'advpoll', 'Vote for or against a number of choices.', '', 1, 'Binary question', 1, 'Description', 0, 0, 0, 1, 'advpoll_binary'),
('image', 'Image', 'image', 'An image (with thumbnail). This is ideal for publishing photographs or screenshots.', '', 1, 'Title', 1, 'Body', 0, 0, 0, 1, 'image'),
('poll', 'Poll', 'poll', 'A <em>poll</em> is a question with a set of possible responses. A <em>poll</em>, once created, automatically provides a simple running count of the number of votes received for each response.', '', 1, 'Question', 0, '', 0, 0, 1, 1, 'poll'),
('panel', 'Panel', 'panels_node', 'A panel a page layout broken up into rows and columns.', '', 1, 'Title', 1, 'Teaser', 0, 0, 0, 1, 'panel'),
('simplenews', 'Newsletter issue', 'node', 'A newsletter issue to be sent to subscribed email addresses.', '', 1, 'Title', 1, 'Body', 0, 1, 1, 0, 'simplenews'),
('petition', 'Petition', 'petition', 'Create and maintain online petitions', '', 1, 'Title', 1, 'Petition text', 0, 0, 0, 1, 'petition'),
('paypaldonations', 'Paypal_donations', 'node', 'you can donate to NNYD through paypal by this...', '', 1, 'Title', 0, '', 0, 1, 1, 0, ''),
('pressrelease', 'PressRelease', 'node', 'Contains all press releases', '', 1, 'Title', 1, 'Body', 0, 1, 1, 0, ''),
('advpoll_ranking', 'Ranking poll', 'advpoll', 'Rank a number of choices.', '', 1, 'Ranking question', 1, 'Description', 0, 0, 0, 1, 'advpoll_ranking');
