(135, 'node', ' gujarat chief minister mr narednra modi announces skillenhancementaidpackage for the unemployed diamondartisans pdf version printerfriendly version b chief minister shri narendrabhai modi has announced a skill enhancement training and aid package for the diamond artisans who are facing the adverse impacts of global meltdown global economy goes on a downward spiral many diamond artisans are facing the crisis of unemployment with a view to provide alternate employment and skill enhancing training to such diamond workers a special relief package is declared narendramodigallerydisplayjpg stipend of rs100 per day for all the trainees unemployed diamondartisans from surat ahmedabad and bhavnagar are to be covered initially chief minister shri narendrabhai modi has announced a skill enhancement training and aid package for the diamond artisans who are facing the adverse impacts of global meltdown global economy goes on a downward spiral many diamond artisans are facing the crisis of unemployment with a view to provide alternate employment and skill enhancing training to such diamond workers a special relief package is declared under the skill enhancementaid package in the primary stage training and aid would be made available to the meltdown affected diamond workers of surat ahmedabad and bhavnagar against the wageloss unemployed diamondartisans would get stipend of rs100 per day during their training period stipend limit is fixed up to rs2500 per month training modulefour months training module is designed to train them for diamond assortment bruiting grading of diamonds planning and making jewellery making and other trade related skills once they finish the training state government would initiate procedures for their loan under vajpayee bankable scheme kutir and gramodhyog schemes and prime minister s employment programme curricula of skill enhancement training module are to be decided in consultation with gujarat council for vocational training and idi of indian government five institutes have been shortlisted which includes 1 indian diamond institute surat 2 national institute of design nid ahmedabad 3 national institute of fashion technology nift gandhinagar 4 gujarat diamond industries training institute rakhial ahmedabad 5 national institute of jewellery design renowned government nongovernment and private institutes may be roped in for providing training training institutes are to be paid rs2700 per trainee for their tuition fees certification examfees procuring training materials and other expenses in the first phase rs12 crore have been sanctioned to train 15000 diamond workers director of employment and vocational training and industries commissioner will jointly organize and implement the skill enhancement package under the guidance of principal secretary industries and mines a statelevel committee will execute the programme in three cities a district level committee would function under district collector and would explore alternate employment options information bureau government of gujarat date 28022009   ', 0),
(43, 'node', ' welcome to nnyd site nav nirman yuva dal is the concept of an nonresidential gujarati mr roshan shah who like any other nri was quite taken aback by the current state of affairs in the country and decided to voice his opinion he used the channel of the various web properties that he either acquired or developed as part of the products which his company bpo canada made to voice his views about gujarat in particular and india in general one can easily find a number of articles published by him on wwwgujjuwebcom  when the idea of forming a party came to him he along with a group of employees of drupal designs software services pvt ltd ddsspl formed the political party and named it nav nirman yuva dal on the famous nav nirman movement taken up by a group of students in ahmedabad    ', 0),
