(134, 'node', ' rahul gandhi indias next generation political hopeful a there is a work that my father had started a dream he had dreamt i come to you today saying allow me to turn that dream into reality rahul gandhi in his address to the people of amethi during the recent election campaign clad in his trademark spotless white kurtapyjama rahulgandhi10jpg rahul gandhi fires amethi s imagination press trust of india amethi april 20 the magic of the nehrugandhi clan seems to be overbearing on this dusty uttar pradesh town where rahul gandhi the youngest member of the dynasty to plunge into electoral politics is in fray for the lok sabha polls that magical surname gandhi and the promise to complete his father and former prime minister rajiv gandhi s dream for the constituency are enough to lead rahul to a landslide victory against his rivals ram vilas vedanti of bjp chandraprakash mishra of bsp and nine others expecting congress president sonia gandhi to contest from amethi samajwadi party did not field its candidate in the constituency as rahul crisscrosses the constituency he evokes the memories of his father he looks just like his father says durga devi as she gets back to harvesting the wheat crop in nearby fields rahul fires the imagination of the people of amethi by promising to fulfill his father s dream for the constituency there is a work that my father had started a dream he had dreamt i come to you today saying allow me to turn that dream into reality he tells the people here charming them with his every move a congress bastion amethi has in the past elected rahul s parents and uncle so strong is the family name in amethi that the party has won 11 of the last 13 lok sabha polls   ', 0),
(136, 'node', ' women would play a crucial role in the development of gujarat chief minister c chief minister shri narendrabhai modi has called upon the narishakti of gujarat to play a crucial role in state s development state government has undertaken slew of measures to empower the womenfolk women are engaged in economic activities they are also playing an important role in the administrative process chief minister was addressing a women mega convention at dhoraji today stairwaytosuccessjpg chief minister shri narendrabhai modi has called upon the narishakti of gujarat to play a crucial role in state s development state government has undertaken slew of measures to empower the womenfolk women are engaged in economic activities they are also playing an important role in the administrative process chief minister was addressing a women mega convention at dhoraji today chief minister distributed aids benefits and tools to women beneficiaries under various welfare and development schemes shri narendrabhai modi dedicated bhadar2 linked group water supply scheme rs 13 crore water supply project would provide drinking water supply to 30 villages when water supply gets erratic womenfolk face the hardships of water scarcity for long term solutions to water crisis in rural areas water committees are formed in thousands of villages such committees functions under women leadership they look after water distribution and maintenance anganvadies are playing very important role in child development the anganwadi workers are given uniforms by state government recently formed yashoda gaurav nidhi ensures dignity and respect to retiring anganwadi workers from the corpus anganwadi workers would get retirement benefits up to rs175 lakhs chiranjeevi scheme has saved the lives of poor mothers and children unicef and commonwealth countries are impressed by its success now balsakha scheme takes care of new born babies the healthcare expenditure of mothers and children up to one year is to be borne by state government a people s movement is launched to tackle malnutrition in pregnant mother and children people are donating sukhadi as a revolving fund for 356 self help women groups shri narendrabhai modi handed over a cheque of rs 1780 lakhs he also distributed sewing machines to the beneficiaries gave way a cheque of rs233 lakh under balika samrudhdhi scheme he had given away a cheque to the president of water committee as self reliance reward revenue minister smt anandiben patel said under the leadership of chief minister separate department is formed with the outlay of rs1000 crores it has operationlised various welfare and development schemes for women integrated child development project falls under the purview of women and child welfare department training is given to 10000 women for making them self reliant water resources minister shri nitinbhai patel said that gone is the era when water was being supplied to villages by water tankers the drinking water grid laid across the state provides drinking water to 10346 villages and 112 towns out of 18000 villages 10000 villages would get water of narmada mp shri haribhai chaudhari mla smt jashumatiben korat former mp shri bhavanaben dave shri madhuben patel chairman social welfare board smt jayshriben patel also addressed the convention eminent leaders mlas office bearers top officials were among the others who attended the mega convention of women information bureau government of gujarat date 19022009   ', 0),
(137, 'node', ' political theatre please vote  d very soon world s largest democracy is going to see an election and the best step which ec has taken is blanket ban on exit polls till last phase of polls i appreciate the steps ec has taken for the worlds largest democracy because this matters a lot for voters indiaelectioncommissionjpg ref  http wwwkhadayataonlinecom blog sshah politicaltheatrepleasevote political theatre politics is it big what do you think what i think is common man hate this word i do not know about you but i do hate it too any how it is fact politics is politics and we cannot ignore it very soon world s largest democracy is going to see an election and the best step which ec has taken is blanket ban on exit polls till last phase of polls i appreciate the steps ec has taken for the worlds largest democracy because this matters a lot for voters now obiviouos question for every indian is who is next but do you think it is that important some countries who is strategic partner of india also will be eager to know who is next i can t compare this with the us elections as it is one of the largest economy and most of the contries in world have direct interest in us including india but i can be sure us will have intrest on the indian elections because of importance of india to control terrorism factory from indian neigbouring countries where us cannot continue its military aid or actions during the time of recession and the aid which is provided to them is also of no use election date is out the code of conduct is deployed war of words has already began and thats what i call to an election campaign war of words or a blame game most of the politician do is just blame each other personally thats what they fill is the best way to get seat for them aim is to get seat and they are good in it the blame game may help them to brain wash some of people but not all now the another question i would like to mention is politicians are good at gettting their seat then what about us where are we good at ask your self you would not have forgot when in last election mrs sonia gandhi called mr modi as merchant of death in gujarat and in reply modi called her as italian dog which does not help to any of parties congress did not get enough seat in gujarat while bjp did not get the power for center but was able to manage in gujarat during last elections the main party most preferably a winner who did the real changes was dmk from tamil nadu where all the 39 available seat from tamilnadu went to dmk a clean swift isn t it dmk supported upa moral of the story is people from tamilnadu was smart enough or rather they have asked them self where are we good at to understand whoever is the pm they should remember that they have to take care of tamil nadu well and so they went and vote there is always inconsistency at central level atleast as of now where pm comes through alliance and so he has to manage all parties and the states which belongs to respective parties to make sure that they does not lose support and this is the fact which no one can change it but i feel it is much better for states having their own political parties consider the example of tamil nadu in last election because of this incosistency at central level many people do not like to vote in election considering the governement is doing nothing for them which is not a good idea you should also believe that the who ever pm is there is always a politics involved in it and a thing is common for each parties that is they can t ignore us to get seat again and so development must be in agenda whatever they have done in last five years will directly reflects in next election we know we are not blind and so politician knows it the other worst thing in indian politics is corruption which i prefer is much better now atleast in gujarat then how it was before being a gujarati i know about gujarat and it is not tough to find out who is corrupted or where corruption occurs when there are so many local media as well as central media available corruption is always the problem and can be sorted out by negative votes good news is even election commision is also looking seriously in this matter to provide a button which says none of the above bingo for voters if it comes to reality ec has also appointed the 5 judge committee to find out the possibility and feasibility and the great stuff is political parties are shaken as they knows if it comes true corrupted persons cannot stand in elections which is more than half in every parties so at last i would say your vote is valuable please vote atleast just go for vote booth where you may find a button none of the above  ', 0),
