(142, 'node', ' gujarat youth congress to hold repoll at 14 places it has been decided to hold repoll at 14 places in gujarat as large scale irregularities were reported from these places in the polling of the youth congress on tuesday elections of youth congress were held in all 182 assembly segments in gujarat announcing this ashok tanvar said that 55 to 60 percent polling was reported in the state he said that it showed large scale involvement of youth in the elections gujarat is the second state after punjab where elections of youth congress are being held to a question he said that in punjab polling percentage was 35 per cent he described irregularities as over enthusiasm of the members but asserted that action would be taken against members involved in these incidents he said that already one member karnsinh was suspended in the naroda area of ahmedabad patan city mehsana nikol naroda and asarwa in ahmedabad rajkot navsari gandevi udhna bhavnagar gadhada surat karjan chhota udaipur dabhoi junagadh and una are the places where repolling will be done in every assembly segment 16 members are to be elected and as a result there will be 2912 elected delegates of youth congress in gujarat he said state level elections are to be held on april 5  politics  ', 0),
